 INSERT INTO srdb.assessment VALUES('DFO-QUE-GHAL4RST-1970-2002-PREFONTAINE', 'DFO-QUE', 'GHAL4RST', 'PREFONTAINE', '2008-07-03', '2009-03-17 21:09:37', '1970-2002', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'Brigitte Bernier, Brigitte.Bernier@dfo-mpo.gc.ca', 'In the assessment separate values can be found for length at 50% maturity for females and for males; the former are represented by 1 and the latter by 2 in the various biometric values. Catch per unit effort was provided by Brigitte Bernier and taken from Figure 4 in the assessment; it is the standardized catch rate (units unknown) of traditional gillnet fishermen.', '', 0, 0, 'Unknown', 'no comments', '../spreadsheets/PREFONTAINE-GHAL4RST-2003-editedDR.xls') ; 
